import styles from '../VincentContainer/VincentContainer.module.css';

const VincentContainer = ({ familyMemberName, familyMemberImageUrl }) => {
    return (
        <div className={styles.div}>
            <div className={styles.bg} />
            <div className={styles.content}>
                <div className={styles.title}>
                    <div className={styles.vincentSmith}>{familyMemberName}</div>
                    <div className={styles.brandCo}>{`Brand & Co`}</div>
                </div>
                <img className={styles.avatarIcon} alt="" src={familyMemberImageUrl} />
                <div className={styles.amazing}>Amazing!!</div>
                <div className={styles.overallExperienceIs}>
                    Overall experience is awesome!! I'm a visual thinker, and I couldn't function without a studio like
                    this.
                </div>
            </div>
        </div>
    );
};

export default VincentContainer;
